import React from "react";

const PlanSummary = () => {
  // Dummy data
  const planName = "Retirement Plan";
  const totalValue = 125000;

  return (
    <section
      style={{
        background: "#ede9fe",
        borderRadius: 16,
        padding: "2rem",
        marginBottom: "2rem",
        boxShadow: "0 2px 8px #a78bfa33",
        textAlign: "center",
      }}
    >
      <h2 style={{ color: "#7c3aed", fontSize: "2rem", marginBottom: 8 }}>
        {planName}
      </h2>
      <div style={{ fontSize: "1.5rem", color: "#3b0764", fontWeight: 700 }}>
        Total Value:{" "}
        <span style={{ color: "#7c3aed" }}>${totalValue.toLocaleString()}</span>
      </div>
    </section>
  );
};

export default PlanSummary;
